import React, { useContext } from 'react'
import { dataContext } from '../Context/DataContext'
import { Container } from 'react-bootstrap'

function Products() {
    const { data } = useContext(dataContext)
  return (
            <div>
                {data.map((product)=>(
                    <img src={product.photo} />
                ))}
            </div>
    )

}

export default Products
